    background: '#fff',
    borderBottom: '2px solid #1890ff'
  },
  tabBtn: {
    fontSize: '14px',
    fontWeight: 500,
    color: '#666',
    transition: 'color 0.3s ease',
    whiteSpace: 'nowrap'
  },
  tabBtnActive: {
    color: '#1890ff',
    fontWeight: 600
  }
};

const HandoverDetailPage: React.FC = () => {
  const navigate = useNavigate();
  const { id } = useParams<{ id: string }>();
  const location = useLocation();

  // 
  useEffect(() => {
    const style = document.createElement('style');
    style.textContent = `
      .ant-tabs-nav-list {
        width: 100% !important;
        display: flex !important;
        justify-content: space-between !important;
      }
      .ant-tabs-tab {
        flex: 1 !important;
        text-align: center !important;
        margin: 0 !important;
        padding: 16px 0 !important;
        min-width: 0 !important;
      }
      .ant-tabs-tab-btn {
        width: 100% !important;
        text-align: center !important;
      }
      .ant-tabs-ink-bar {
        width: 60% !important;
        margin-left: 20% !important;
      }
      .ant-tabs-nav {
        margin: 0 !important;
      }
    `;
    document.head.appendChild(style);

    return () => {
      document.head.removeChild(style);
    };
  }, []);
  const [loading, setLoading] = useState(true);
  const [handoverData, setHandoverData] = useState<CustomerHandover | null>(null);
  const [onboardingTasks, setOnboardingTasks] = useState<OnboardingTask[]>([]);
  const [internalComments, setInternalComments] = useState<InternalComment[]>([]);
  const [newComment, setNewComment] = useState('');
  const [stakeholders, setStakeholders] = useState<Stakeholder[]>([]);
  const [analysisData, setAnalysisData] = useState({
    painPoints: '',
    successCriteria: '',
    risks: '',
  });

  //  URL  tab URL 
  const searchParams = new URLSearchParams(location.search);
  const defaultTab = searchParams.get('tab') || 'action-plan';
  const [activeTab, setActiveTab] = useState<string>(defaultTab);

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const tab = params.get('tab') || 'action-plan';
    setActiveTab(tab);
  }, [location.search]);

  useEffect(() => {
    const loadData = async () => {
      console.log('ID:', id);
      setLoading(true);
      try {
        await new Promise(resolve => setTimeout(resolve, 500));

        const data = mockCustomerHandovers.find(item => item.id === id);
        console.log(':', data);
        if (data) {
          setHandoverData(data);
          setOnboardingTasks(data.onboardingTasks || mockOnboardingTasks);
          setInternalComments(data.internalComments || mockInternalComments);
          setStakeholders(data.stakeholders || mockStakeholders);

          // 
          setAnalysisData({
            painPoints: data.corePainPoints || '',
            successCriteria: data.successCriteria || '',
            risks: data.riskDetails || '',
          });

          // 
          const title = `${data.customerName} - `;
          document.title = title;

          // tab
          setTimeout(() => {
            const event = new CustomEvent('tabTitleUpdate', {
              detail: { path: location.pathname, title }
            });
            window.dispatchEvent(event);
          }, 100);

        } else {
          console.log('ID:', id);
          message.error('');
          navigate('/profiles/handover-implementation');
        }
      } catch (error) {
        console.error(':', error);
        message.error('');
      } finally {
        setLoading(false);
      }
    };

    loadData();
  }, [id, navigate]);

  // 
  const handleBack = () => {
    // tab
    const event = new CustomEvent('tabClose', {
      detail: { path: location.pathname }
    });
    window.dispatchEvent(event);

    // tab
    setTimeout(() => {
      navigate('/profiles/handover-implementation');
    }, 50);
  };

  // 
  const handleNewSuggestion = () => {
    message.success('""');
  };

  // 
  const handleEdit = () => {
    message.info('...');
  };

  // 
  const handleViewContract = () => {
    message.info('...');
  };

  // 
  const handleShare = () => {
    message.info('...');
  };

  // 
  const handleTaskToggle = (taskId: string) => {
    const newTasks = onboardingTasks.map(task => 
      task.id === taskId ? { ...task, completed: !task.completed } : task
    );
    setOnboardingTasks(newTasks);
  };

  // 
  const handleAddComment = () => {
    if (!newComment.trim()) {
      message.warning('');
      return;
    }

    const comment: InternalComment = {
      id: Date.now().toString(),
      content: newComment,
      author: 'CSM-',
      createdAt: new Date().toLocaleString('zh-CN'),
    };

    setInternalComments([comment, ...internalComments]);
    setNewComment('');
    message.success('');
  };

  // 
  const handleStakeholderUpdate = (updatedStakeholder: Stakeholder) => {
    setStakeholders(prev => 
      prev.map(s => s.id === updatedStakeholder.id ? updatedStakeholder : s)
    );
  };

  // 
  const handleStakeholderAdd = (newStakeholder: Stakeholder) => {
    setStakeholders(prev => [...prev, newStakeholder]);
  };

  // 
  const handleStakeholderDelete = (id: string) => {
    setStakeholders(prev => prev.filter(s => s.id !== id));
  };

  if (loading) {
    return (
      <div style={{ 
        padding: '24px', 
        textAlign: 'center',
        background: '#f5f5f5',
        minHeight: 'calc(100vh - 120px)',
        paddingBottom: '60px' // footer
      }}>
        <div>...</div>
      </div>
    );
  }

  if (!handoverData) {
    return (
      <div style={{ 
        padding: '24px', 
        textAlign: 'center',
        background: '#f5f5f5',
        minHeight: 'calc(100vh - 120px)',
        paddingBottom: '60px' // footer
      }}>
        <div></div>
      </div>
    );
  }

  // 
  const statusColorMap = {
    normal: 'green',
    not_handover: 'orange',
    risk: 'red'
  };

  const statusTextMap = {
    normal: '',
    not_handover: '',
    risk: ''
  };

  const riskColorMap = {
    high: 'red',
    medium: 'orange',
    low: 'green'
  };

  const riskTextMap = {
    high: '',
    medium: '',
    low: ''
  };
  const ORG_CHART_HEIGHT = 560;

  return (
    <>
      <Helmet>
        <title>
          {handoverData ? `${handoverData.customerName} - ` : ''}
        </title>
      </Helmet>
      <div style={{
        padding: '24px',
        background: '#f5f5f5',
        minHeight: 'calc(100vh - 120px)',
        paddingBottom: '60px' // footer
      }}>
        <div style={{
          maxWidth: '1200px',
          margin: '0 auto'
        }}>

        {/*  */}
        <div style={{ marginBottom: '24px' }}>
          <HandoverDetailHeader
            handoverData={handoverData}
            onBack={handleBack}
            onEdit={handleEdit}
            onViewContract={handleViewContract}
            onShare={handleShare}
          />
        </div>
        {/*  */}
        <div style={{
          backgroundColor: '#fff',
          borderRadius: '8px',
          overflow: 'hidden',
          boxShadow: '0 1px 2px rgba(0, 0, 0, 0.03)'
        }}>
          <Tabs
            activeKey={activeTab}
            onChange={(key) => {
              setActiveTab(key as string);
              //  URL
              const params = new URLSearchParams(location.search);
              params.set('tab', String(key));
              navigate(`${location.pathname}?${params.toString()}`, { replace: true });
            }}
            style={{
              margin: 0
            }}
            tabBarStyle={{
              margin: 0,
              backgroundColor: '#fff',
              borderBottom: '1px solid #f0f0f0',
              padding: '0 24px',
              width: '100%'
            }}
            size="large"
            type="line"
            items={[
            {
              key: 'action-plan',
              label: '',
              children: (
                <div style={{ padding: '24px' }}>
                  {/* Onboarding */}
                  <Card title="Onboarding" style={{ marginBottom: '16px', borderRadius: '8px' }} size="small">
                    <div style={{ padding: '8px 0' }}>
                      {onboardingTasks.map((task) => (
                        <div key={task.id} style={{ marginBottom: '12px' }}>
                          <Checkbox checked={task.completed} onChange={() => handleTaskToggle(task.id)}>
                            <span style={{ textDecoration: task.completed ? 'line-through' : 'none', color: task.completed ? '#999' : '#333', fontSize: '14px' }}>
                              {task.title}
                            </span>
                          </Checkbox>
                          {task.dueDate && (
                            <Text type="secondary" style={{ fontSize: '12px', marginLeft: '8px' }}>
                              {task.dueDate}
                            </Text>
                          )}
                        </div>
                      ))}
                    </div>
                  </Card>

                  {/*  */}
                  <Card title="" style={{ marginBottom: '16px', borderRadius: '8px' }} size="small">
                    <div style={{ maxHeight: '240px', overflowY: 'auto' }}>
                      {internalComments.slice(0, 5).map((comment) => (
                        <div key={comment.id} style={{ padding: '12px 0', borderBottom: '1px solid #f0f0f0' }}>
                          <div style={{ display: 'flex', alignItems: 'center', marginBottom: '6px' }}>
                            <Avatar icon={<UserOutlined />} size={24} style={{ marginRight: '8px' }} />
                            <span style={{ fontWeight: 500 }}>{comment.author}</span>
                            <span style={{ color: '#999', marginLeft: '8px', fontSize: '12px' }}>{comment.createdAt}</span>
                          </div>
                          <div style={{ fontSize: '14px' }}>{comment.content}</div>
                        </div>
                      ))}
                    </div>
                  </Card>

                  {/*  */}
                  <Card style={{ marginBottom: '16px', borderRadius: '8px' }} size="small">
                    <Collapse defaultActiveKey={[]} ghost expandIcon={({ isActive }) => (isActive ? <UpOutlined /> : <DownOutlined />)}>
                      <Panel header="" key="communication">
                        <div style={{ padding: '8px 0' }}>
                          <div style={{ marginBottom: '20px' }}>
                            <TextArea placeholder="@..." value={newComment} onChange={(e) => setNewComment(e.target.value)} rows={3} style={{ marginBottom: '8px' }} />
                            <Button type="primary" size="small" onClick={handleAddComment}>

                            </Button>
                          </div>
                          <Divider style={{ margin: '16px 0' }} />
                          <div>
                            <Text strong style={{ display: 'block', marginBottom: '12px', color: '#333' }}>

                            </Text>
                            <div style={{ maxHeight: '300px', overflowY: 'auto' }}>
                              {internalComments.map((comment) => (
                                <div key={comment.id} style={{ marginBottom: '16px', padding: '12px', border: '1px solid #f0f0f0', borderRadius: '6px', background: '#fff' }}>
                                  <div style={{ display: 'flex', alignItems: 'center', marginBottom: '8px' }}>
                                    <Avatar icon={<UserOutlined />} style={{ marginRight: '8px' }} />
                                    <span style={{ fontWeight: 'bold', fontSize: '14px' }}>{comment.author}</span>
                                    <span style={{ color: '#999', marginLeft: '8px', fontSize: '12px' }}>{comment.createdAt}</span>
                                  </div>
                                  <div style={{ fontSize: '14px', lineHeight: '1.5' }}>
                                    {comment.content}
                                    {comment.mentions && comment.mentions.length > 0 && (
                                      <div style={{ marginTop: '4px' }}>
                                        {comment.mentions.map(mention => (
                                          <Tag key={mention} color="blue">
                                            @{mention}
                                          </Tag>
                                        ))}
                                      </div>
                                    )}
                                  </div>
                                </div>
                              ))}
                            </div>
                          </div>
                        </div>
                      </Panel>
                    </Collapse>
                  </Card>
                </div>
              )
            },
            {
              key: 'basic-info',
              label: '',
              children: (
                <div style={{ padding: '24px' }}>
                  <Card title="" size="small" style={{ marginBottom: '16px', borderRadius: '8px' }}>
                    <Descriptions column={1} size="small">
                      <Descriptions.Item label="">{handoverData.customerName}</Descriptions.Item>
                      <Descriptions.Item label="">
                        <Tag color={statusColorMap[handoverData.handoverStatus]}>{statusTextMap[handoverData.handoverStatus]}</Tag>
                      </Descriptions.Item>
                      <Descriptions.Item label="">
                        <Tag color={riskColorMap[handoverData.riskLevel]}>{riskTextMap[handoverData.riskLevel]}</Tag>
                      </Descriptions.Item>
