import React, { useMemo, useState } from 'react';
import { 
  Card, 
  Row, 
  Col, 
  Input, 
  Select, 
  Table, 
  Tag, 
  Progress, 
  Statistic, 
  Space, 
  Typography, 
  Divider, 
  Tooltip,
  Button,
  message,
  Drawer,
  Descriptions,
  Timeline,
  Badge,
  Switch
} from 'antd';
import {
  UserOutlined,
  SearchOutlined,
  ReloadOutlined,
  ExportOutlined,
  SettingOutlined
} from '@ant-design/icons';

type HealthLevel = '' | '' | '';
type Lifecycle = '' | '' | '';

interface AccountRow {
  key: string;
  name: string;
  owner: string;
  health: HealthLevel;
  healthScore: number;
  riskReason?: string;
  opportunityType?: string;
  lastInteractionDays: number;
  lifecycle: Lifecycle;
  renewalRisk: boolean;
  onboardingCompleted: boolean;
  profileCompleteness: number;
  handoverCompleted: boolean;
}

const mockAccounts: AccountRow[] = [
  { key: 'a1', name: 'A', owner: '', health: '', healthScore: 65, riskReason: '', lastInteractionDays: 12, lifecycle: '', renewalRisk: true, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
  { key: 'a2', name: 'B', owner: '', health: '', healthScore: 88, opportunityType: 'NPS', lastInteractionDays: 7, lifecycle: '', renewalRisk: false, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
  { key: 'a3', name: 'C', owner: '', health: '', healthScore: 72, lastInteractionDays: 33, lifecycle: '', renewalRisk: false, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
  { key: 'a4', name: 'D', owner: '', health: '', healthScore: 54, riskReason: '', lastInteractionDays: 3, lifecycle: '', renewalRisk: true, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
  { key: 'a5', name: 'E', owner: '', health: '', healthScore: 92, opportunityType: '', lastInteractionDays: 45, lifecycle: '', renewalRisk: false, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
  { key: 'a6', name: 'F', owner: '', health: '', healthScore: 76, lastInteractionDays: 29, lifecycle: '', renewalRisk: false, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
  { key: 'a7', name: 'G', owner: '', health: '', healthScore: 61, riskReason: '', lastInteractionDays: 40, lifecycle: '', renewalRisk: true, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
];

const healthColorMap: Record<HealthLevel, string> = {
  : '#52c41a',
  : '#8c8c8c',
  : '#fa541c',
};

const ServiceWorkbench: React.FC = () => {
  // 
  const [searchParams, setSearchParams] = useState({
    customerName: '',
    healthLevel: undefined as HealthLevel | undefined,
    lifecycle: undefined as Lifecycle | undefined,
    renewalRisk: undefined as boolean | undefined
  });

  // /
  const [showMyCustomersOnly, setShowMyCustomersOnly] = useState(true);
  const currentUser = ''; // 

  // 
  const [currentPage, setCurrentPage] = useState(1);
  const pageSize = 10;

  // 
  const [drawerVisible, setDrawerVisible] = useState(false);
  const [selectedRecord, setSelectedRecord] = useState<AccountRow | null>(null);

  // 
  const handleSearch = () => {
    setCurrentPage(1);
    message.success('');
  };

  // 
  const handleReset = () => {
    setSearchParams({
      customerName: '',
      healthLevel: undefined,
      lifecycle: undefined,
      renewalRisk: undefined
    });
    setCurrentPage(1);
    message.success('');
  };

  // 
  const handleExport = () => {
    message.success('...');
  };

  // 
  const handleViewDetail = (record: AccountRow) => {
    setSelectedRecord(record);
    setDrawerVisible(true);
  };

  // 
  const handleCloseDrawer = () => {
    setDrawerVisible(false);
    setSelectedRecord(null);
  };

    //  - 100%
  const filteredAccounts = useMemo(() => {
    return mockAccounts.filter(acc => {
      // 100%
      if (!acc.handoverCompleted || acc.profileCompleteness < 100) {
        return false;
      }

      // /
      if (showMyCustomersOnly && acc.owner !== currentUser) {
        return false;
      }

      // 
      const matchName = !searchParams.customerName || 
        acc.name.includes(searchParams.customerName);
      const matchHealth = !searchParams.healthLevel || 
        acc.health === searchParams.healthLevel;
      const matchLifecycle = !searchParams.lifecycle || 
        acc.lifecycle === searchParams.lifecycle;
      const matchRenewalRisk = typeof searchParams.renewalRisk === 'undefined' || 
        acc.renewalRisk === searchParams.renewalRisk;

      return matchName && matchHealth && matchLifecycle && matchRenewalRisk;
    });
  }, [searchParams, showMyCustomersOnly, currentUser]);

  // 
  const paginatedData = useMemo(() => {
    const startIndex = (currentPage - 1) * pageSize;
    return filteredAccounts.slice(startIndex, startIndex + pageSize);
  }, [filteredAccounts, currentPage]);

  // 
  const counts = useMemo(() => {
    const total = filteredAccounts.length || 1;
    const healthy = filteredAccounts.filter(a => a.health === '').length;
    const medium = filteredAccounts.filter(a => a.health === '').length;
    const risky = filteredAccounts.filter(a => a.health === '').length;
    const avgHealth = Math.round(
      filteredAccounts.reduce((s, a) => s + a.healthScore, 0) / Math.max(1, filteredAccounts.length)
    );
    return { total, healthy, medium, risky, avgHealth };
  }, [filteredAccounts]);

  // 
  const columns = [
    {
      title: '',
      dataIndex: 'name',
      key: 'name',
      width: 150,
      align: 'center' as const,
      render: (name: string) => (
        <a style={{ color: '#1890ff' }}>{name}</a>
      ),
    },
    {
      title: '',
      dataIndex: 'owner',
      key: 'owner',
      width: 120,
      align: 'center' as const,
    },
    {
      title: '',
      dataIndex: 'health',
      key: 'health',
      width: 120,
      align: 'center' as const,
      render: (health: HealthLevel) => (
        <Tag color={healthColorMap[health]}>{health}</Tag>
      ),
    },
    {
      title: '',
      dataIndex: 'healthScore',
      key: 'healthScore',
      width: 100,
      align: 'center' as const,
      render: (score: number) => (
        <span style={{ fontWeight: 500 }}>{score}</span>
      ),
    },
    {
      title: '',
      dataIndex: 'lifecycle',
      key: 'lifecycle',
      width: 120,
      align: 'center' as const,
    },
    {
      title: '',
      dataIndex: 'lastInteractionDays',
      key: 'lastInteractionDays',
      width: 120,
      align: 'center' as const,
      render: (days: number) => (
        <span>{days === 0 ? '' : `${days} `}</span>
      ),
    },
    {
      title: '',
      dataIndex: 'renewalRisk',
      key: 'renewalRisk',
      width: 120,
      align: 'center' as const,
      render: (risk: boolean, record: AccountRow) => (
        <Tooltip title={risk ? '' : ''}>
          <Progress
            percent={risk ? Math.min(95, 50 + (100 - record.healthScore)) : 8}
            size="small"
            showInfo={false}
            strokeColor={risk ? '#fa541c' : '#bfbfbf'}
          />
        </Tooltip>
      ),
    },
    {
      title: '',
      key: 'action',
      width: 120,
      align: 'center' as const,
      render: (_: any, record: AccountRow) => (
        <Space>
          <a onClick={() => handleViewDetail(record)}></a>
          <a></a>
        </Space>
      ),
    },
  ];

  return (
    <div style={{
      padding: '24px',
      background: '#f5f5f5',
      minHeight: 'calc(100vh - 120px)',
      paddingBottom: '60px'
    }}>
      <div style={{
        maxWidth: '1400px',
        margin: '0 auto'
      }}>
        {/*  */}
        <div style={{ marginBottom: '24px' }}>
          <Typography.Title level={2} style={{ margin: 0, color: '#262626' }}></Typography.Title>
          <Typography.Text type="secondary"></Typography.Text>
        </div>

        {/*  */}
        <div style={{ marginBottom: '24px' }}>
          <Row gutter={16}>
            <Col xs={24} sm={8}>
              <Card style={{ borderRadius: '8px' }}>
                <Statistic title="" value={counts.total} valueStyle={{ fontWeight: 700 }} />
              </Card>
            </Col>
            <Col xs={24} sm={8}>
              <Card style={{ borderRadius: '8px' }}>
                <Statistic title="" value={counts.avgHealth} valueStyle={{ fontWeight: 700 }} />
              </Card>
            </Col>
            <Col xs={24} sm={8}>
              <Card style={{ borderRadius: '8px' }}>
                <Statistic title="" value={counts.risky} valueStyle={{ fontWeight: 700 }} />
              </Card>
            </Col>
          </Row>
        </div>

                {/*  */}
        <div style={{ 
          background: '#fff',
          borderRadius: '8px',
          padding: '24px',
          marginBottom: '24px',
          boxShadow: '0 1px 2px rgba(0, 0, 0, 0.03)'
        }}>
          <div style={{ 
            display: 'flex', 
            alignItems: 'center',
            gap: '16px'
          }}>
            <Input 
              allowClear 
              placeholder=": " 
              value={searchParams.customerName}
              onChange={(e) => setSearchParams(prev => ({ ...prev, customerName: e.target.value }))}
              style={{ width: 220 }}
              size="middle"
            />
            <Select
              allowClear
              placeholder=": "
              value={searchParams.healthLevel}
              onChange={(value) => setSearchParams(prev => ({ ...prev, healthLevel: value }))}
              style={{ width: 180 }}
              size="middle"
            >
              <Select.Option value=""></Select.Option>
              <Select.Option value=""></Select.Option>
              <Select.Option value=""></Select.Option>
            </Select>
            <Select
              allowClear
              placeholder=": "
              value={searchParams.lifecycle}
              onChange={(value) => setSearchParams(prev => ({ ...prev, lifecycle: value }))}
              style={{ width: 180 }}
              size="middle"
            >
              <Select.Option value=""></Select.Option>
              <Select.Option value=""></Select.Option>
              <Select.Option value=""></Select.Option>
            </Select>
            <Select
              allowClear
              placeholder=": "
              value={searchParams.renewalRisk}
              onChange={(value) => setSearchParams(prev => ({ ...prev, renewalRisk: value }))}
              style={{ width: 180 }}
              size="middle"
            >
              <Select.Option value={true}></Select.Option>
              <Select.Option value={false}></Select.Option>
            </Select>

            <div style={{ marginLeft: 'auto' }}>
              <Space size="small">
                <Switch 
                  checked={showMyCustomersOnly}
                  onChange={setShowMyCustomersOnly}
                  size="small"
                  checkedChildren=""
                  unCheckedChildren=""
                />
                <Divider type="vertical" />
                <Button onClick={handleReset}>

                </Button>
                <Button 
                  type="primary" 
                  icon={<SearchOutlined />}
                  onClick={handleSearch}
                >

                </Button>
                <Button 
                  icon={<ExportOutlined />}
                  onClick={handleExport}
                >

                </Button>
              </Space>
            </div>
          </div>
        </div>

        {/*  */}
        <div style={{
          background: '#fff',
          borderRadius: '8px',
          boxShadow: '0 1px 2px rgba(0, 0, 0, 0.03)'
        }}>
          <Table
            rowKey="key"
            columns={columns}
            dataSource={paginatedData}
            pagination={{
              current: currentPage,
              pageSize: pageSize,
              total: filteredAccounts.length,
              showSizeChanger: false,
              showQuickJumper: true,
              showTotal: (total, range) => `${range[0]}-${range[1]}/${total}`,
              onChange: (page) => setCurrentPage(page),
            }}
            size="middle"
          />
        </div>

        {/*  */}
        <Drawer
          title={
            <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
              <div style={{ 
                width: '40px', 
                height: '40px', 
                borderRadius: '50%', 
                background: '#1890ff', 
                display: 'flex', 
                alignItems: 'center', 
                justifyContent: 'center',
                color: 'white',
                fontSize: '16px',
                fontWeight: 'bold'
              }}>
                {selectedRecord?.name.charAt(0)}
              </div>
              <div>
                <Typography.Title level={4} style={{ margin: 0 }}>{selectedRecord?.name}</Typography.Title>
                <Typography.Text type="secondary"></Typography.Text>
              </div>
            </div>
          }
          placement="right"
          width={600}
          open={drawerVisible}
          onClose={handleCloseDrawer}
          extra={
            <Space>
              <Button size="small"></Button>
              <Button type="primary" size="small"></Button>
            </Space>
          }
        >
          {selectedRecord && (
            <div style={{ padding: '0 16px' }}>
              {/*  */}
              <Card title="" size="small" style={{ marginBottom: 16 }}>
                <Descriptions column={2} size="small">
                  <Descriptions.Item label="">{selectedRecord.name}</Descriptions.Item>
                  <Descriptions.Item label="">{selectedRecord.owner}</Descriptions.Item>
                  <Descriptions.Item label="">
                    <Tag color={healthColorMap[selectedRecord.health]}>{selectedRecord.health}</Tag>
                  </Descriptions.Item>
                  <Descriptions.Item label="">{selectedRecord.healthScore}</Descriptions.Item>
                  <Descriptions.Item label="">{selectedRecord.lifecycle}</Descriptions.Item>
                  <Descriptions.Item label="">
                    {selectedRecord.lastInteractionDays === 0 ? '' : `${selectedRecord.lastInteractionDays} `}
                  </Descriptions.Item>
                  <Descriptions.Item label="">
                    <Badge 
                      status={selectedRecord.renewalRisk ? 'error' : 'success'} 
                      text={selectedRecord.renewalRisk ? '' : ''} 
                    />
                  </Descriptions.Item>
                  <Descriptions.Item label="">
                    <Progress percent={selectedRecord.profileCompleteness} size="small" />
                  </Descriptions.Item>
                </Descriptions>
              </Card>

              {/*  */}
              {(selectedRecord.riskReason || selectedRecord.opportunityType) && (
                <Card title="" size="small" style={{ marginBottom: 16 }}>
                  {selectedRecord.riskReason && (
                    <div style={{ marginBottom: 12 }}>
                      <Typography.Text strong style={{ color: '#fa541c' }}></Typography.Text>
                      <Typography.Text>{selectedRecord.riskReason}</Typography.Text>
                    </div>
                  )}
                  {selectedRecord.opportunityType && (
                    <div>
                      <Typography.Text strong style={{ color: '#52c41a' }}></Typography.Text>
                      <Typography.Text>{selectedRecord.opportunityType}</Typography.Text>
                    </div>
                  )}
                </Card>
              )}

              {/*  */}
              <Card title="" size="small" style={{ marginBottom: 16 }}>
                <Timeline
                  items={[
                    {
                      color: 'green',
                      children: (
                        <div>
                          <Typography.Text strong></Typography.Text>
                          <br />
                          <Typography.Text type="secondary">2024-01-15 14:30</Typography.Text>
                          <br />
                          <Typography.Text></Typography.Text>
                        </div>
                      ),
                    },
                    {
                      color: 'blue',
                      children: (
                        <div>
                          <Typography.Text strong></Typography.Text>
                          <br />
                          <Typography.Text type="secondary">2024-01-10 09:15</Typography.Text>
                          <br />
                          <Typography.Text>API</Typography.Text>
                        </div>
                      ),
                    },
                    {
                      color: 'orange',
                      children: (
                        <div>
                          <Typography.Text strong></Typography.Text>
                          <br />
                          <Typography.Text type="secondary">2024-01-05 16:00</Typography.Text>
                          <br />
                          <Typography.Text></Typography.Text>
                        </div>
                      ),
                    },
                  ]}
                />
              </Card>

              {/*  */}
              <Card title="" size="small">
                <Space wrap>
                  <Button size="small" type="primary"></Button>
                  <Button size="small"></Button>
                  <Button size="small"></Button>
                  <Button size="small"></Button>
                  <Button size="small" danger={selectedRecord.renewalRisk}></Button>
                </Space>
              </Card>
            </div>
          )}
        </Drawer>

      </div>
    </div>
  );
};

