    message.success(`: ${action}`);
  };

  // 
  const handleCloseCustomerDetail = () => {
    setCustomerDetailVisible(false);
    setSelectedCustomer(null);
  };

  // 
  const getColumns = () => [
    {
      title: '',
      dataIndex: 'customerName',
      key: 'customerName',
      align: 'center' as const,
