      title: '',
      dataIndex: 'healthScore',
      key: 'healthScore',
      align: 'center' as const,
      render: (score: number, record: RenewalCustomer) => (
        <div style={{ textAlign: 'center' }}>
          <div style={{ 
            fontWeight: 600, 
            color: record.healthLevel === '' ? '#52c41a' : 
