                  />
                </Card>
              </Col>
              <Col span={12}>
                <Card style={{ borderRadius: '8px', textAlign: 'center' }}>
                  <Statistic
                    title=""
                    value={Math.abs(kpiData.churnAmount)}
                    prefix="-"
                    suffix=""
                    valueStyle={{ color: '#fa541c', fontSize: '20px', fontWeight: 'bold' }}
                  />
                </Card>
              </Col>
            </Row>
          </Col>
        </Row>

        {/*  */}
        <Row gutter={24}>
          {/*  */}
          <Col span={16}>
            <Card 
              title=""
              style={{ borderRadius: '8px' }}
              extra={
                <Space>
                  <Select
                    defaultValue="current"
                    style={{ width: 140 }}
                    onChange={setTimeRange}
                    options={[
