                style={{ borderRadius: '8px' }}
              >
                <Timeline
                  items={mockRenewalActivities.map(activity => ({
                    color: activity.color,
                    children: (
                      <div>
                        <div style={{ fontWeight: 500, marginBottom: '4px' }}>
